import React,{Component} from 'react';
import './App.css';
import getUserData from './actions/index';
import { connect } from "react-redux";


export class App extends Component{

constructor(props){
  super(props);
}

componentDidMount(){
  this.props.getUserData();
}
render() {

    const ConnectedList = ({ users }) => (

      users.map(el => (

    <div id='User' key={el.id} className='User' data-item={el.id}>
     <div id='header'>
      <label id='name'>{el.name.length <= 0 ? 'No Name' : el.name}</label>
      <label id='prof'>{el.occupation}</label>
     </div>
     <div id='email'>
      <label>{el.email.length <= 0 ? 'No Email' : el.email}</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>{el.bio.length <= 0 ? 'No Bio' : el.bio}</p>
     </div>
     </div>
      <button id="btn" onClick={ ()=> this.userClicked(el.id)} >PATCH</button>
    </div>
    ))


);
     return(
        {ConnectedList}
      );

}

}
export default connect(null,{getUserData})(App);
